import Home from "./Home";
import { Route, Routes } from "react-router-dom";
import Filtered from "./Filtered";

function Pages() {
  return (
    <Routes>
      <Route path="/home" element={<MainPage />} />
      <Route path="/home/:id" element={<Filtered />} />
    </Routes>
  );
}

export default Pages;
